import styled from "@emotion/styled";

export const AppBarContainer = styled.div`
    width: 100%;
    height: 70px;
    background-color: white;
    color: #15023a;
    position: fixed;
    z-index: 2;
`

export const AppBarWrapper = styled.div`
    padding: 10px 30px;
    display: flex;
    align-items: center;
    justify-content: space-between;
`
